webpackJsonp([0xe305b26781f3],{398:function(e,t){e.exports={data:{site:{siteMetadata:{title:"huan9huan的博客",author:"huang huan"}},markdownRemark:{id:"/Users/alhuang/work/blog/src/pages/cs-is-big-hummer/index.md absPath of file >>> MarkdownRemark",html:"<p>吴军：从计算机终究是一种工具</p>\n<p>1/ 计算机终究是一个工具，早意识到这一点，早一点会脱离 <em>计算机本位主义</em></p>\n<p>2/ 我自己从大学接触计算机，就痴迷于写代码，而且认为写代码是大于天的一个工作，这让我走不出领域业余的困境。</p>\n<p>3/ 只做计算机编程（CS），单纯比拼写代码的能力高低，最后会落入到和年轻人比拼精力的境地，是一个深坑。</p>\n<p>4/ 要重视领域知识的积累和深入，才能脱身码农的行列。战略调整是必须的，以前的战略是，写代码的IC；现在要调整为善于做产品的Maker</p>\n<p>5/ 自我认知的纠正很难，从习惯做起，降低写代码的时间量，逐渐转换到研究问题上。</p>",frontmatter:{title:"CS is a big hummer",date:"July 14, 2018"}}},pathContext:{slug:"/cs-is-big-hummer/",previous:{fields:{slug:"/full-engagement/"},frontmatter:{title:"从张遇升精品课学到的"}},next:{fields:{slug:"/fine-tuning-captcha/"},frontmatter:{title:"Fine Tuning Captcha"}}}}}});
